      <AuthProvider>
      <Navbar/>
      <Routes>
        <Route path='' element={<SignUp/>}></Route>
        <Route path='/DashBoard' element={<DashBoard/>}></Route>
        <Route path='/Cart' element={<Cart />}></Route>
        <Route path="/products/:id" element={<ProductDetails />}></Route>
